import { useSelector } from "react-redux";

const Users = () => {
  let users = useSelector((state) => {
    return state.users;
  });

  console.log("Users:", users);
  return (
    <div>
      <h1>Users</h1>
      <div>
        {users.map((user) => (
          <div>{user.name}</div>
        ))}
      </div>
    </div>
  );
};

export default Users;
